INSERT INTO `nachricht` (`NachrichtID`, `Text`, `RechteID`, `Veroeffentlichungstermin`) VALUES
(1, 'Ab heute werden Ã¼ber diesen Nachrichten-Bereich neue Features, wichtige Updates und aktuelle Belange im Bezug auf meinFHD kundgetan.\r\n\r\nEs lohnt sich also, hin und wieder einen Blick hierauf zu werfen!', 1, '2010-10-06 00:48:45'),
(2, 'Durch eine kleine Erweiterung kÃ¶nnen Studierende ab sofort in ihrem Stundenplan sehen, ob noch freie PlÃ¤tze und wenn ja, wie viele freie PlÃ¤tze eine Veranstaltung besitzt.\r\nDies gilt allerdings nur fÃ¼r die Veranstaltungen die _nicht_ vom Typ "Vorlesung" oder "Tutorium" sind.', 4, '2010-10-06 00:51:41'),
(3, 'Die Benutzerverwaltung ist um ein Feature erweitert worden:\r\nAb sofort muss man sich nicht durch die gesamte Liste alle Benutzer (aktuell ca. 380 Studenten z.B.) kÃ¤mpfen, sondern kann mit Hilfe eines universalen Suchfeldes den gesuchten Eintrag direkt finden.', 2, '2010-11-08 12:37:12'),
(4, 'Die WahlpflichtfÃ¤cher (WPF) werden in einer eigenen Veranstaltung vorgestellt (Donnerstag, 17.3. um 14:00 im Raum L 1.2). Dort wird auch bekannt gegeben, wie Sie sich fÃ¼r die Angebote anmelden, bzw. bewerben kÃ¶nnen. In Ihrem persÃ¶nlichen Stundenplan sind die WPF daher nicht mehr sichtbar. Die bisherigen (vorzeitigen) Anmeldungen verfallen aus dem gleichen Grund.', 4, '2011-03-11 13:50:57'),
(5, 'Liebe Studierende\r\n\r\nZu Beginn des Semester kann es schon mal vorkommen, dass bei der Organisation von Veranstaltungen hier und da noch etwas geÃ¤ndert werden muss.\r\nSo auch im Fach â€žDatenbanksysteme 2â€œ. Hier mussten die Praktikumstermine neu organisiert werden.\r\nAus diesem Grund konnten die bisherigen Anmeldungen fÃ¼r dieses Fach nicht beibehalten werden.\r\n\r\nWir bitten Sie daher, sich erneut fÃ¼r die jetzt endgÃ¼ltigen Praktikumsgruppen einzutragen.\r\nKeine Sorge, das Praktikum beginnt erst nÃ¤chste Woche, weshalb Sie jetzt nicht in Panik geraten mÃ¼ssen.', 4, '2011-03-18 08:17:36'),
(6, 'NUR B.Sc. Medieninformatik, 1. Semester: Die Anmeldungen zu P/Ãœ/S-Gruppen sind freigeschaltet.', 4, '2011-09-23 06:18:54'),
(7, 'Seit diesem Sommer gibt es eine neue Funktion fÃ¼r Sie in meinFHD. \r\nUm Ihnen stressfreie Ã„nderungen an Terminlichkeiten zu ermÃ¶glichen, wurde eine Anmelde-Sperre fÃ¼r Studierende eingefÃ¼hrt.\r\nDiese Sperre ist standardmÃ¤ÃŸig aktiv und muss zum Semesteranfang entsperrt werden, damit die Studierenden sich fÃ¼r Lehrveranstaltungen anmelden kÃ¶nnen.\r\nDiese Funktion finden Sie bei den Details Ihrer FÃ¤cher in der FÃ¤cherverwaltung.', 3, '2011-09-28 16:32:39'),
(8, 'Liebe Studierenden \r\n\r\nDie StundenplÃ¤ne fÃ¼r das anstehende SoSe 2012 sind online. Die Seminare/Ãœbungen/Praktika werden innerhalb der nÃ¤chsten zwei Wochen von den zustÃ¤ndigen Dozenten zur Anmeldung fÃ¼r Sie freigegeben - sofern nicht andere Mittel zur Anmeldung (wie z.B. Papierlisten oder Moodle) benutzt werden.\r\nSprechen Sie im Zweifel als erstes den jeweiligen Dozenten an, ob er meinFHD zur Anmeldung benutzt oder nicht.\r\n\r\nViele GrÃ¼ÃŸe\r\nDer meinFHD-Support', 4, '2012-03-16 16:52:33'),
(9, 'Liebe Dozenten\r\n\r\nDie StundenplÃ¤ne fÃ¼r das anstehende SoSe 2012 sind online und Sie haben ab jetzt die MÃ¶glichkeit Ihre Praktika/Ãœbungen/Seminare zur Anmeldung Ã¼ber meinFHD freizugeben.\r\nSollten Sie dazu fragen haben, kÃ¶nnen Sie sich jederzeit per Email an den meinFHD-Support wenden (meinfhd.medien@fh-duesseldorf.de).\r\n\r\nViele GrÃ¼ÃŸe\r\nJochen Sauer (meinFHD-Support)', 3, '2012-03-16 16:54:32');
