(4, 3, '20110706', '12:00', 60, 'H 1.20', 4, 'Jeder stellt in 10 Minuten dar, was seine Aufgabe innerhalb des Projekts war, seine LÃ¶sungsansÃ¤tze und das Ergebnis. \r\nAuÃŸerdem sollte jeder etwas zum Gesamtprojekt, zur Aufgabe, zum Ablauf, zur Planung und zu den gewonnenen Erfahrungen sagen. PrÃ¤sentieren Sie mÃ¶glichst verstÃ¤ndlich und anschaulich, d.h. mit Grafiken und Beispielen. Zeigen Sie aber keinen Sourcecode sondern statt dessen z.B. UML-Diagramme der Strukturen und AblÃ¤ufe.\r\n\r\nIn Ihre Benotung fliesst sowohl der gesamte Projekverlauf als auch Ihr Vortrag ein.\r\n', 0),
