(1, '2008', 'B.Sc Medieninformatik', 'BMI', 6, 180, 0, 5, 'Dieser akkreditierte Studiengang aus dem Bereich Medieninformatik bietet ein starkes Fundament in der Informatik ergÃ¤nzt um Grundlagen der Mediengestaltung. Darauf bauen fortgeschrittene Anwendungen der Medieninformatik auf - beispielsweise in der Computergrafik, interaktiven Systemen, E-Business und IT-Sicherheit. In praxisnahen Projekten werden Medienanwendungen konzipiert, gestaltet und implementiert. Diese Ausbildung ist eine exzellente Vorbereitung auf Informatikorientierte Berufsfelder in der Medienbranchen, sei es in der Mediensoftware-Entwicklung oder Beratung, in Werbe- und Multimediaagenturen oder auch in der Medienproduktion.\r\n\r\nDie Regelstudienzeit betrÃ¤gt sechs Semester. Nach der bestandenen Bachelorarbeit verleiht die Fachhochschule DÃ¼sseldorf den ersten berufsqualifizierenden Abschluss "Bachelor of Science".'),
(2, '2005', 'B.Sc Medien und angewandte IT', 'BMAIT', 6, 180, 0, 5, 'Dieser akkreditierte Studiengang aus dem Bereich Medieninformatik bietet ein starkes Fundament in der Informatik ergÃ¤nzt um Grundlagen der Mediengestaltung. Darauf bauen fortgeschrittene Anwendungen der Medieninformatik auf - beispielsweise in der Computergrafik, interaktiven Systemen, E-Business und IT-Sicherheit. In praxisnahen Projekten werden Medienanwendungen konzipiert, gestaltet und implementiert. Diese Ausbildung ist eine exzellente Vorbereitung auf Informatikorientierte Berufsfelder in der Medienbranchen, sei es in der Mediensoftware-Entwicklung oder Beratung, in Werbe- und Multimediaagenturen oder auch in der Medienproduktion.    Die Regelstudienzeit betrÃ¤gt sechs Semester. Nach der bestandenen Bachelorarbeit verleiht die Fachhochschule DÃ¼sseldorf den ersten berufsqualifizierenden Abschluss "Bachelor of Science".'),
(3, '2008', 'B.Eng Medientechnik', 'BMT', 7, 210, 0, 5, 'Mit dem Bachelorstudiengang "Medientechnik" bietet die Fachhochschule DÃ¼sseldorf ein interdisziplinÃ¤res und praxisorientiertes Hochschulstudium im Bereich der digitalen Medien an.\r\nInhaltlich verbindet der Studiengang technische Grundlagen aus den Bereichen der Elektrotechnik, Mathematik, Informatik und Computergrafik mit anwendungsorientierter Projektarbeit.\r\nDurch die Kombination von Technik, Konzeption und Gestaltung werden die Absolventen bestmÃ¶glich auf ihr zukÃ¼nftiges Einsatzfeld im Bereich der modernen Multimediatechnik vorbereitet. \r\n\r\nDer Studiengang umfasst, einschlieÃŸlich eines Praxissemesters und der Abschlussarbeit, sieben Semester. Nach erfolgreichem Abschluss verleiht die Fachhochschule DÃ¼sseldorf den akademischen Grad "Bachelor of Engineering" (B.Eng).'),
(4, '2008', 'B.Mus. Eng. Ton u. Bild', 'BTUB', 8, 240, 0, 5, 'Der Studiengang Ton und Bild ist einmalig in der Bundesrepublik Deutschland.\r\n\r\nDie Lehrveranstaltungen finden an zwei Hochschulen statt. Die Fachhochschule DÃ¼sseldorf bietet die technische Qualifikation, die Robert-Schumann-Hochschule vermittelt die kÃ¼nstlerisch-gestalterische Qualifikation.\r\n\r\nDas Studium hat eine Regelstudienzeit von 8 Semestern. Nach der bestandenen AbschlussprÃ¼fung erhÃ¤lt der Absolvent den akademischen Grad "Bachelor of Music and Engineering".'),
(5, '2006', 'M.Sc Virtuelle RealitÃ¤t ', 'MVR', 4, 120, 0, 5, 'Mit dem akkreditierten Masterstudiengang "Virtuelle RealitÃ¤t" bietet der Fachbereich Medien \r\n\r\neine fundierte, technisch ausgerichtete Ausbildung in einem faszinierenden Gebiet der Informatik/Computergrafik. \r\n\r\nDas viersemestrige Studium dient der wissenschaftlichen Vorbereitung der Studierenden auf die Berufspraxis, einem anschlieÃŸenden Promotionsstudium an einer UniversitÃ¤t oder der BefÃ¤higung zum hÃ¶heren Dienst. Erfolgreiche Absolventen des Masters "Virtuelle RealitÃ¤t" kÃ¶nnen nachweisen, dass sie in der Lage sind: \r\n\r\n- komplexe IT-Problemstellungen exakt und vollstÃ¤ndig zu analysieren, \r\n- LÃ¶sungskonzepte strukturiert und methodisch fundiert zu entwickeln, \r\n- eine Realisierung effizient und zielgerichtet zu implementieren und \r\n- in interdisziplinÃ¤ren Teams aktiv zu partizipieren sowie Kommunikation und Kooperation als essentielle Basis gemeinsamen erfolgreichen Arbeitens zu verstehen.'),
(6, '2005', 'B.Eng Medientechnik', 'BMT', 7, 210, 0, 5, 'Mit dem Bachelorstudiengang "Medientechnik" bietet die Fachhochschule DÃ¼sseldorf ein interdisziplinÃ¤res und praxisorientiertes Hochschulstudium im Bereich der digitalen Medien an.\r\nInhaltlich verbindet der Studiengang technische Grundlagen aus den Bereichen der Elektrotechnik, Mathematik, Informatik und Computergrafik mit anwendungsorientierter Projektarbeit.\r\nDurch die Kombination von Technik, Konzeption und Gestaltung werden die Absolventen bestmÃ¶glich auf ihr zukÃ¼nftiges Einsatzfeld im Bereich der modernen Multimediatechnik vorbereitet. \r\n\r\nDer Studiengang umfasst, einschlieÃŸlich eines Praxissemesters und der Abschlussarbeit, sieben Semester. Nach erfolgreichem Abschluss verleiht die Fachhochschule DÃ¼sseldorf den akademischen Grad "Bachelor of Engineering" (B.Eng).'),
(7, '2010', 'B.Sc Medieninformatik', 'BMI', 7, 210, 0, 5, 'Dieser akkreditierte Studiengang aus dem Bereich Medieninformatik bietet ein starkes Fundament in der Informatik ergÃ¤nzt um Grundlagen der Mediengestaltung. Darauf bauen fortgeschrittene Anwendungen der Medieninformatik auf - beispielsweise in der Computergrafik, interaktiven Systemen, E-Business und IT-Sicherheit. In praxisnahen Projekten werden Medienanwendungen konzipiert, gestaltet und implementiert. Diese Ausbildung ist eine exzellente Vorbereitung auf Informatikorientierte Berufsfelder in der Medienbranchen, sei es in der Mediensoftware-Entwicklung oder Beratung, in Werbe- und Multimediaagenturen oder auch in der Medienproduktion.\r\n\r\n\r\nDie Regelstudienzeit betrÃ¤gt sieben Semester. Nach der bestandenen Bachelorarbeit verleiht die Fachhochschule DÃ¼sseldorf den ersten berufsqualifizierenden Abschluss "Bachelor of Science".'),
(9, '2010', 'B.Eng Medientechnik', 'BMT', 7, 210, 0, 5, 'Der Bachelorstudiengang â€žMedientechnikâ€œ (B. Eng.) stellt die klassische Berufsqualifikation fÃ¼r den Beruf des Medientechnik-Ingenieurs / der Medientechnik-Ingenieurin dar. Er besitzt im Wesentlichen ein naturwissenschaftlich-technisches und informatorisches Fundament.\r\n\r\nDarÃ¼ber hinaus gehÃ¶ren auch betriebswirtschaftliche Anteile zum Lehrangebot. Die Inhalte der Eingangsphase des Studiums werden zum einen aus mathematisch-naturwissenschaftlichen FÃ¤chern gespeist und zum anderen aus GrundlagenfÃ¤chern der Elektrotechnik und der Informatik. Die wesentlichen medientechnischen GrundlagenfÃ¤cher bilden eine breite Basis, mit der MÃ¶glichkeit, diese in einer 2-semestrigen Vertiefungsphase in den Berufsfeldvertiefungen â€žAudioâ€œ, â€žVideoâ€œ, â€žVirtuelle RealitÃ¤tâ€œ, â€žAV-PrÃ¤sentationstechnik / Event Systemsâ€œ und â€žWeb / Multimediaâ€œ fortzufÃ¼hren. Das Studium sieht umfangreiche praktische Anteile in allen Phasen vor, insbesondere auch im Rahmen von grÃ¶ÃŸeren Projektveranst'),
(10, '2010', 'M.Sc Medieninformatik', 'MMI', 4, 120, 0, 5, 'Ziel des 3-semestrigen, eher anwendungsorientierten Masterstudiengangs Medieninformatik ist die konsekutive Fortsetzung des 7-semestrigen Bachelorstudiengangs Medieninformatik. FÃ¼r Bewerber mit einem 6-semestrigen Erststudium existiert eine Ãœbergangsregelung. Der Beginn des Studiums ist zu jedem Semester mÃ¶glich. Neben einer obligatorischen Vertiefung in vier KernfÃ¤chern bietet der Masterstudiengang eine groÃŸe FlexibilitÃ¤t bei der FÃ¤cherwahl. Studenten kÃ¶nnen zwei Projekte sowie sechs Module aus einem flexibel erweiterbaren FÃ¤cherkatalog wÃ¤hlen. Dieser beinhaltet unterschiedlich ausgerichtete FÃ¤cher wie Multimedia-Kommunikation, Sicherheitsmanagement, Mobile Systeme, Computer Animation, VR und AR Systeme, Digitale Bild- und Videotechnik oder Tonstudiotechnik und Sound Engineering. Es besteht die optionale MÃ¶glichkeit ein Vertiefungsprofil â€žVirtuelle Umgebungenâ€œ bzw. â€žMultimediale Systeme und Anwendungenâ€œ zu studieren. Der Masterstudiengang qualifiziert fÃ¼r anspruch'),
(11, '2010', 'B.Mus. Eng. Ton u. Bild', 'BTUB', 8, 240, 0, 5, 'Der Studiengang Ton und Bild ist einmalig in der Bundesrepublik Deutschland.\r\n\r\nDie Lehrveranstaltungen finden an zwei Hochschulen statt. Die Fachhochschule DÃ¼sseldorf bietet die technische Qualifikation, die Robert-Schumann-Hochschule vermittelt die kÃ¼nstlerisch-gestalterische Qualifikation.\r\n\r\nDas Studium hat eine Regelstudienzeit von 8 Semestern. Nach der bestandenen AbschlussprÃ¼fung erhÃ¤lt der Absolvent den akademischen Grad "Bachelor of Music and Engineering".');
